var App;

App = window.App;

App.Templates = {};

App.Templates.ListedItem = function(model) {
  var compiled, template;
  template = $("#app-item-template").html();
  console.log(template);
  compiled = _.template(template, {
    name: model.name,
    description: model.description
  });
  console.log(compiled);
  return compiled;
};

